import React from 'react'

const Skills = () => {
  const skillset = [
    {name:"Git", 
    href:"https://banner2.cleanpng.com/20180525/uqe/kisspng-github-repository-commit-bitbucket-5b087c10473111.3648804215272827042916.jpg",
    }
  ]
  return (
    <div className='max-w-5xl mx-auto mt-16'>
      <h1 className='text-blue-600 font-semibold text-3xl font-palanquin'>Skills <span className='text-black'>and</span> Technologies</h1>
      <p className='text-slate-gray mt-1 font-montserrat text-lg'>I can't lie, these are the driving force behind my success!</p>
      <div className='grid grid-rows-2 grid-cols-5 bg-gray-100 rounded-xl gap-4 mt-5'>

        {
          skillset.map((skill) => (
              <div className='flex items-center  justify-center flex-col py-5'>
                <img
                 alt=''
                 width={60}
                 src={skill.href} />
              <p className='text-slate-gray opacity-80 text-md'>hi</p>
              </div>
          ))
        }


      </div>
    </div>
  )
}

export default Skills
